sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

  var response_body = JSON.parse(inputs.response_body);

  outputs.city = response_body.location.name;
  outputs.region = response_body.location.region;
  outputs.country = response_body.location.country;
  outputs.latitude = response_body.location.lat;
  outputs.longitude = response_body.location.lon;
  outputs.time_zone = response_body.location.tz_id;

  outputs.temp_c = response_body.current.temp_c;
  outputs.temp_f = response_body.current.temp_f;
  outputs.is_day = response_body.current.is_day;

  outputs.weather_description = response_body.current.condition.text;
  outputs.weather_icon = response_body.current.condition.icon;

  outputs.wind_speed = response_body.current.wind_kph;
  outputs.precipitation = response_body.current.precip_mm;
  outputs.humidity = response_body.current.humidity;

})(inputs, outputs);

